# This program takes an input of 40K 1-byte positive integers in range [1,127]
# 1. Checks if all its elements are inside the desired range
# 2. Sorts the array using the Dutch-National-Flag Quicksort implementation
#    More information here: https://en.wikipedia.org/wiki/Dutch_national_flag_problem
# 3. Searches for a specific number's index in the sorted array with Binary-Search
# ===================================================================================
#
# QuickSort pseudocode:
# algorithm qSort(&array, low, high)
# 	if (low < high) then
# 		left, right <= threeWayPartition(&array, low, high)
# 		quicksort(&array, low, left - 1)
# 		quicksort(&array, right, high)
# end qSort
# 
# procedure threeWayPartition (&array, low, high)
# 	pivot <= array[high]
# 	left, right <= low
# 	bound <= high
# 
# 	while (right <= bound)
# 		if (array[right] < array[pivot])
# 			swap (array[left], array[right])
# 			left++
# 			right++
# 		else if (array[right] > array[pivot])
# 			swap (array[right], array[bound])
# 			bound--
# 		else right++
# 	return left, right
#
# Binary Search pseudocode:
# algorithm bSearch (&array, low, high, x)
# 	index = mid(low, high)
#	if (array[index] == x) return index
# 	if (array[index] < x) bSearch (&array, low, index-1, x)
# 	if (array[index] > x) bSearch (&array, index+1, high, x)
# 	return 0

.text
.globl main

main:
	############## Part A - Check input numbers ##############
	la	$t0,	array		# t0 => arrayPtr = *array
	li	$t1,	40000		# t1 => arraySize
	add	$t1,	$t0,	$t1	# t1 = *array + arraySize
scan:
	beq	$t0,	$t1,	sort	# while *array < array[arraySize]
	lb	$t3,	0($t0)		# t3 = array[i]
	addi	$t0,	$t0,	1	# i++
	blez	$t3,	exit		# if (array[i] <= 0) abort execution
	j	scan
sort:
	################### Part B - QuickSort ###################
	la	$a0,	array		# a0 => arrayPtr = *array
	addi	$a1,	$zero,	0	# a1 => low = 0
	li	$a2,	39999		# a2 => high = arraySize - 1
	jal	qSort			# sort array

	#addi	$t1,	$zero,	0	# array start
	#addi	$t2,	$zero,	50	# array end

	#add	$t3,	$s0,	$zero	# copy array index to t3
printArray:
	#beq	$t1,	$t2,	nextStep	# for (int i = 0; i < arraySize; i++)
	#lb	$a0,	0($t3)
	#jal	print_int
	#la	$a0,	space
	#jal	print_string
	#addi	$t1,	$t1,	1
	#addi	$t3,	$t3,	1
	#j	printArray

nextStep:
	################# Part C - Binary Search #################
	la	$s7,	POS		# s7 = &POS
	addi	$t8,	$zero,	2	# divisor to calculate middle of array
	addi	$a3,	$zero,	92	# a3 = x
	jal	bSearch			# call bSearch(&array, low, high, x)
	lw	$a0,	0($s7)
	jal	print_int
	la	$a0,	newLine
	jal	print_string

exit:
	li	$v0,	10
	syscall

qSort:					# void (int *array, int low, int high)
	addi	$sp,	$sp,	-20	# push down the stack
	sw	$ra,	0($sp)		# store return address
	sw	$a1,	4($sp)		# store a1 = low
	sw	$a2,	8($sp)		# store a2 = high
	sw	$s0,	12($sp)		# store s0 = index of left partition
	sw	$s1,	16($sp)		# store s1 = index of right partition

	slt	$t9,	$a1,	$a2	# check low < high
	beq	$t9,	$zero,	return	# if (low >= high) return

	jal partition

recursiveLeft:
	lw	$a1,	4($sp)		# restore a1
	addi	$a2,	$s0,	-1	# new high = left - 1
	jal	qSort			# call quicksort(&array, low, left - 1)

recursiveRight:
	lw	$a2,	8($sp)		# restore a2
	addi	$a1,	$s1,	0	# new low = right
	jal	qSort			# call quicksort(&array, right, high)

return:
	lw	$ra,	0($sp)		# restore return address
	lw	$a1,	4($sp)		# restore a1
	lw	$a2,	8($sp)		# restore a2
	lw	$s0,	12($sp)		# restore s0
	lw	$s1,	16($sp)		# restore s1
	addi	$sp,	$sp,	20	# pull up the stack
	jr	$ra

partition:				# [int, int] (int *array, int low, int high)
	add	$t0,	$a0,	$a2	# t0 = &array[pivot] => pivot = high
	lb	$t1,	0($t0)		# t1 = array[pivot]
	add	$t2,	$a0,	$a1	# t2 => left = &array[low]
	add	$t3,	$a0,	$a1	# t3 => right = &array[low]
	addi	$t0,	$t0,	1	# t4 => bound + 1 = &array[high + 1]

while:					# while (right <= bound)
	lb	$t5,	0($t3)		# t5 = array[right]
	slt	$t9,	$t3,	$t0	# check right < bound + 1
	beq	$t9,	$zero,	endPart

ifLess:
	slt	$t9,	$t5,	$t1	# check array[right] < array[pivot]
	beq	$t9,	$zero,	ifGreater
	# swap (array[left], array[right])
	lb	$t6,	0($t2)		# t6 = array[left]
	sb	$t5,	0($t2)
	sb	$t6,	0($t3)
	addi	$t2,	$t2,	1	# left++
	addi	$t3,	$t3,	1	# right++
	j	while

ifGreater:
	slt	$t9,	$t1,	$t5	# check array[right] > array[pivot]
	beq	$t9,	$zero,	ifEqual
	addi	$t0,	$t0,	-1	# bound--
	# swap(array[right], array[bound])
	lb	$t6,	0($t0)		# t6 = array[bound]
	sb	$t5,	0($t0)
	sb	$t6,	0($t3)
	j	while

ifEqual:
	addi	$t3,	$t3,	1	# right++
	j	while

endPart:
	sub	$s0,	$t2,	$a0	# return left
	sub	$s1,	$t3,	$a0	# return right
	jr	$ra

	############## Binary Search Implementation ##############
bSearch:				# void (int *array, int low, int high, int x)
	slt	$t9,	$a2,	$a1	# check low >= high
	bne	$t9,	$zero,	bExit	# if (high < low) exit
	add	$t0,	$a1,	$a2	# t0 = low + high
	div	$t0,	$t8		# t0 = (low + high) / 2
	mflo	$t0
	add	$t1,	$a0,	$t0	# t1 => index = &array[pivot]
	lb	$t2,	0($t1)		# t2 = array[index]

	beq	$t2,	$a3,	bReturn	# if (array[index] == x) return index

	slt	$t9,	$a3,	$t2	# if (x < array[index])
	bne	$t9,	$zero,	searchLeft

searchRight:
	addi	$a1,	$t0,	1	# new low = index + 1
	j	bSearch			# call bSearch(&array, index + 1, high, x)

searchLeft:
	addi	$a2,	$t0,	-1	# new high = index - 1
	j	bSearch			# call bSearch (&array, low, index - 1, x)

bReturn:
	sub	$t1,	$t1,	$a0	# calculate the final index of x
	addi	$t1,	$t1,	1	# + 1 to be in range [1,40.000]
	sw	$t1,	0($s7)		# overwrite index at POS
	jr	$ra			# return the index of x in array

bExit:
	jr	$ra			# x not found, return without any further action

########### System calls
print_int:
	li	$v0,	1
	syscall				# move to $a0 to print
	jr	$ra

print_string:
	li	$v0,	4		# print a0 (address of string)
	syscall
	jr	$ra

.data
space: .asciiz " "
newLine: .asciiz "\n"
POS: .word 0				# Binary search result
array:					# 40.000 1-byte positive integers
.byte 3 111 31 37 4 82 17 39 37 14 98 24 32 103 31 126 118 85 80 56 79 36 27 52 90 74 115 10 53 59 88 44 54 41 40 68 34 93 28 17 29 104 74 33 54 28 78 28 15 106 24 105 94 84 24 8 1 47 51 23 123 110 19 49 20 44 78 46 76 80 115 63 37 68 25 20 116 23 6 93 17 48 41 45 37 126 53 33 92 23 100 84 102 40 107 6 90 64 69 22 84 3 19 115 35 70 116 66 12 108 125 94 83 117 21 71 97 71 3 101 19 116 92 101 58 89 60 92 92 41 113 89 50 81 83 86 4 34 117 28 103 61 114 49 92 60 57 79 117 12 68 90 110 6 46 83 1 101 92 90 11 12 54 12 9 86 27 96 100 34 63 66 87 86 94 123 72 12 124 15 77 117 101 81 113 30 61 119 109 46 52 78 127 50 42 42 46 26 58 102 36 6 50 36 123 57 30 87 68 108 42 87 7 86 75 113 98 62 109 80 8 50 54 10 76 1 10 105 107 44 74 70 96 67 44 99 80 64 49 29 112 8 110 35 45 16 3 127 44 15 74 2 35 92 104 120 29 122 36 113 28 95 74 31 120 9 43 91 67 72 37 44 19 93 64 66 84 7 43 90 89 14 96 44 62 23 77 55 53 74 22 6 85 86 21 33 43 54 114 74 45 20 29 44 48 24 2 98 9 4 36 59 123 60 12 12 61 121 19 15 27 127 9 92 85 55 92 48 116 62 41 52 26 108 53 7 64 37 73 33 8 45 17 46 30 56 68 71 11 28 32 94 85 19 114 107 9 35 116 55 8 69 19 77 87 122 30 68 48 106 66 101 112 114 121 54 51 82 91 76 66 80 86 50 126 87 112 30 91 58 58 23 104 27 23 102 104 76 71 72 2 54 86 35 66 35 125 52 114 122 59 98 71 59 59 113 70 1 69 6 102 80 89 3 86 3 65 29 58 29 49 59 20 43 71 82 73 125 51 71 57 115 66 109 76 11 126 46 39 20 5 94 26 75 33 84 116 76 112 1 47 31 17 2 31 31 74 49 51 8 111 87 113 63 60 93 89 6 127 65 27 8 76 17 50 102 88 32 117 14 42 40 16 41 69 96 82 92 26 56 67 75 99 42 89 98 34 82 125 26 58 97 18 101 52 67 118 18 116 108 27 13 18 116 31 90 105 32 79 121 103 68 11 23 82 51 45 51 46 25 64 102 22 112 110 14 97 40 110 78 36 88 26 1 67 32 5 38 97 90 67 94 56 98 9 117 20 88 51 60 33 103 95 88 26 14 58 58 26 115 6 127 11 102 36 76 46 118 90 91 103 114 44 55 13 99 6 73 124 49 123 66 78 66 36 120 66 86 2 72 68 110 101 76 113 122 2 73 74 27 118 91 125 39 74 24 3 32 97 112 60 109 33 3 105 61 109 106 90 6